import React, { useState } from 'react';
import axios from 'axios';
import './Login.css';

const LoginForm = () => {
  const [formData, setFormData] = useState({
    app_id: '',
    app_secret: '',
    redirect_url: ''
  });

  const [resu, setresult] = useState()
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });

  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const params = {
      app_code: formData.app_id,
      app_secret: formData.app_secret,
      redirect_url: formData.redirect_url
    };
    try {
      const response = await axios.post('http://localhost:8000/fyersLogin/loginfyers/', { params: params });
      //   const response = axios.post('http://localhost:8000/fyersLogin/fyersauth/', null, {
      //     params: params
      //   })
      console.log(response)
      setresult(response)
      // Handle response data as needed
    } catch (error) {
      console.error('Error submitting form:', error);
    }
    finally {
      // console.log(response)
    }


  };


  const [authCode, setAuthCode] = useState('');
  const params1 = {
    app_id: '1',
    auth: "formData.app_secret"
  };
  const handleChange1 = (event) => {
    setAuthCode(event.target.value);
    // const params1 = {
    //     app_id: '1',
    //     auth: "formData.app_secret"
    //   };
  };

  const handleSubmit1 = async (event) => {
    const params = {
      app_code: authCode,

    };
    event.preventDefault();
    try {
      // Make a POST request to submit the authentication code to Django
      const response = axios.post('http://localhost:8000/fyersLogin/fyersauth/', null, {
        params: params
      })
      console.log('Authentication code submitted successfully:');
      // Handle success (e.g., display a success message)
    } catch (error) {
      console.error('Error submitting authentication code:', error);
      // Handle error (e.g., display an error message)
    }
    finally{
      // console.log(response)
    }
  };

  const [formData1, setFormData1] = useState({
    app_id: '',
    app_secret: '',
    redirect_url: ''
  });

  const handleInputChange = (fieldName, value) => {
    setFormData({ ...formData, [fieldName]: value });
  };

  const handleSelectChange = (fieldName, event) => {
    const value = event.target.value;
    setFormData({ ...formData, [fieldName]: value });
  };

  const showSelect = (fieldName) => {
    const input = document.getElementById(`${fieldName}_input`);
    const select = document.getElementById(`${fieldName}_select`);
    input.style.display = "none";
    select.style.display = "block";
    select.focus();
  };

  return (<>

    <div className="login-form-page">
    <div>
      <form onSubmit={(e) => handleSubmit(e)}>
        <div id="app_id_container">
          <input
            type="text"
            id="app_id_input"
            value={formData.app_id}
            onFocus={() => showSelect('app_id')}
            onChange={(e) => handleInputChange('app_id', e.target.value)}
            placeholder="Select or type App ID"
          />
          <select
            id="app_id_select"
            style={{ display: 'none' }}
            onChange={(e) => handleSelectChange('app_id', e)}
          >
            <option value="" disabled selected>Select App ID</option>
            <option value="app_id_1">App ID 1</option>
            <option value="app_id_2">App ID 2</option>
            <option value="app_id_3">App ID 3</option>
            {/* Add more options as needed */}
          </select>
        </div>
        {/* Repeat the above for other fields */}
        <button type="submit">Submit</button>
      </form>
      <h1>The value</h1>
    </div>
      <div className="login-form-container">
        <form className="login-form" onSubmit={handleSubmit}>
          <div className='login_heading'>Auth login</div>
          <input className="login-field login-input" type="text" name="app_id" value={formData.app_id} onChange={handleChange} placeholder="App ID" />
          <input className="login-field login-input" type="text" name="app_secret" value={formData.app_secret} onChange={handleChange} placeholder="App Secret" />
          <input className="login-field login-input" type="text" name="redirect_url" value={formData.redirect_url} onChange={handleChange} placeholder="Redirect URL" />
          <button className="login-field login-button" type="submit">Submit</button>
          <p></p>
        </form>

        <div>
        <span>-</span>
        <span>-</span>
        <span>-</span>
        </div>

        <form className="login--container" onSubmit={handleSubmit1}>
      <label>
        Auth Code:
        <input className="login-input login-field" 
          type="text"
          value={authCode}
          onChange={handleChange1}
          placeholder="Enter authentication code"
        />
      </label>
      
      <button className="login-button login-field"  type="submit">Submit</button>
    </form>

      </div>
      

    </div>




  </>);
};

export default LoginForm;
